import React, { useState } from "react";
import { Form } from "react-bootstrap";
import axios from "axios";

const Registracija = () => {
    const [ime, setIme] = useState('');
    const [prezime, setPrezime] = useState('');
    const [adresa, setAdresa] = useState('');
    const [post_broj, setPost_broj] = useState('');
    const [mjesto, setMjesto] = useState('');
    const [kontakt, setKontakt] = useState('');
    const [email, setEmail] = useState('');
    const [kor_ime, setKor_ime] = useState('');
    const [lozinka, setLozinka] = useState('');

    const addKlijentProHandler = async () => {
        const data = {
            ime: ime,
            prezime: prezime,
            adresa: adresa,
            post_broj: post_broj,
            mjesto: mjesto,
            kontakt: kontakt,
            email: email,
            kor_ime: kor_ime,
            lozinka: lozinka
        }
        await axios.post('/api/aplikacija/addKlijentProfil', data)
    }

    return (
        <>
            <h1 className="d-grid gap-2 col-6 mx-auto">Registracija</h1>
            <hr/>
            <div className="d-grid gap-2 col-6 mx-auto">

                <Form onSubmit={addKlijentProHandler}>
                    <div className="mb-3">
                        <label htmlFor="Ime" className="form-label">Ime: </label>
                        <input type="Ime" className="form-control" id="Ime" placeholder="Ivan"
                            value={ime}
                            onChange={(e) => setIme(e.target.value)} />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="Prezime" className="form-label">Prezime: </label>
                        <input type="text" className="form-control" id="Prezime" placeholder="Horvat"
                            value={prezime}
                            onChange={(e) => setPrezime(e.target.value)}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="Adresa" className="form-label">Adresa: </label>
                        <input type="text" className="form-control" id="Adresa" placeholder="Ulica Straha 1"
                            value={adresa}
                            onChange={(e) => setAdresa(e.target.value)}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="Post_broj" className="form-label">Poštanski broj: </label>
                        <input type="text" className="form-control" id="Post_broj" placeholder="10000"
                            value={post_broj}
                            onChange={(e) => setPost_broj(e.target.value)}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="Mjesto" className="form-label">Mjesto: </label>
                        <input type="text" className="form-control" id="Mjesto" placeholder="Zagreb"
                            value={mjesto}
                            onChange={(e) => setMjesto(e.target.value)}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="Kontakt" className="form-label">Kontakt: </label>
                        <input type="text" className="form-control" id="Kontakt" placeholder="0958517126"
                            value={kontakt}
                            onChange={(e) => setKontakt(e.target.value)}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="Email" className="form-label">Email adresa: </label>
                        <input type="text" className="form-control" id="Email" placeholder="name@example.com"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="Kor_ime" className="form-label">Željeno korisničko ime: </label>
                        <input type="text" className="form-control" id="Kor_ime" placeholder="Korisničko ime"
                            value={kor_ime}
                            onChange={(e) => setKor_ime(e.target.value)}
                        />
                    </div>
                    <label htmlFor="Lozinka" className="form-label">Lozinka: </label>
                    <input type="Password" id="Lozinka" className="form-control" aria-describedby="passwordHelpBlock"
                        value={lozinka}
                        onChange={(e) => setLozinka(e.target.value)}
                    />
                    <div id="passwordHelpBlock" className="form-text"> </div>
                    <div className="d-grid gap-2 col-6 mx-auto">
                        <button type="button" className="btn btn-outline-dark ms-2" data-bs-toggle="modal" data-bs-target="#loginModal">
                            <i className="fa fa-sign-in me-2"></i>Registracija
                        </button>
                    </div>
                </Form>
            </div>


        </>
    )
}
export default Registracija;
